import React from 'react';
import styles from './eventBox.module.css'; // Pour le CSS
import img1 from './image1.png'
const events = [
  // Événements en cours
  {
    id: 1,
    title: "Événement en cours 1",
    image: {img1},
    description: "Description de l'événement en cours 1",
    location: "Lieu 1",
    organizer: "Organisateur 1",
    date: "2024-11-20",
    status: "En cours",
    rating: null
  },
  {
    id: 2,
    title: "Événement en cours 2",
    image: "/path/to/image2.jpg",
    description: "Description de l'événement en cours 2",
    location: "Lieu 2",
    organizer: "Organisateur 2",
    date: "2024-11-22",
    status: "En cours",
    rating: null
  },
  // Événements à venir
  {
    id: 3,
    title: "Événement à venir 1",
    image: "/path/to/image3.jpg",
    description: "Description de l'événement à venir 1",
    location: "Lieu 3",
    organizer: "Organisateur 3",
    date: "2024-12-05",
    status: "À venir",
    rating: null
  },
  {
    id: 4,
    title: "Événement à venir 2",
    image: "/path/to/image4.jpg",
    description: "Description de l'événement à venir 2",
    location: "Lieu 4",
    organizer: "Organisateur 4",
    date: "2024-12-10",
    status: "À venir",
    rating: null
  },
  // Événements terminés
  {
    id: 5,
    title: "Événement terminé 1",
    image: "/path/to/image5.jpg",
    description: "Description de l'événement terminé 1",
    location: "Lieu 5",
    organizer: "Organisateur 5",
    date: "2024-10-15",
    status: "Terminé",
    rating: 4.5
  },
  {
    id: 6,
    title: "Événement terminé 2",
    image: "/path/to/image6.jpg",
    description: "Description de l'événement terminé 2",
    location: "Lieu 6",
    organizer: "Organisateur 6",
    date: "2024-10-20",
    status: "Terminé",
    rating: 3.8
  }
];

const EventBox = () => {
  return (
    <div className={styles.eventContainer}>
      {events.map((event) => (
        <div className={styles.eventBox} key={event.id}>
          <img src={event.image} alt={event.title} className={styles.eventImage} />
          
        </div>
      ))}
    </div>
  );
};

export default EventBox;
